import { useState } from "react";
import ExpencesIteam from "./ExpencesIteam";
const ListExpences = () => {
  const AddedData = [
    { id: "l1", date: new Date(2021, 5, 21), title: "manoj", amount: 220 },
  ];
  return (
    <div>
      <ul>
        <ExpencesIteam
          title={AddedData[0].title}
          id={AddedData[0].id}
          date={AddedData[0].date.toISOString()}
          amount={AddedData[0].amount}
        ></ExpencesIteam>
      </ul>
    </div>
  );
};
export default ListExpences;
